	private OwnerRepository owners;

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetController controller;

	@Test
	@DisplayName("populatePetTypes should return collection of pet types when called")
	void populatePetTypes_returnsPetTypes() {
		List<PetType> petTypes = List.of(new PetType(), new PetType());
		when(types.findPetTypes()).thenReturn(petTypes);

		Collection<PetType> result = controller.populatePetTypes();

		assertNotNull(result);
		assertEquals(2, result.size());
	}

	@Test
	@DisplayName("populatePetTypes should return empty collection when no pet types")
	void populatePetTypes_withNoTypes_returnsEmpty() {
		when(types.findPetTypes()).thenReturn(Collections.emptyList());

		Collection<PetType> result = controller.populatePetTypes();

		assertNotNull(result);
		assertTrue(result.isEmpty());
	}

	@Test
	@DisplayName("findOwner should return owner when found")
	void findOwner_withValidId_returnsOwner() {
		Owner owner = new Owner();
		owner.setId(1);
		when(owners.findById(1)).thenReturn(Optional.of(owner));

		Owner result = controller.findOwner(1);

		assertNotNull(result);
		assertEquals(1, result.getId());
	}

	@Test
    @DisplayName("findOwner should throw IllegalArgumentException when not found")
    void findOwner_withInvalidId_throwsException() {
        when(owners.findById(999)).thenReturn(Optional.empty());

        IllegalArgumentException exception = assertThrows(;
            IllegalArgumentException.class,
            () -> controller.findOwner(999);
        );

        assertNotNull(exception);
    }

}

import java.util.HashMap;
import java.util.Map;
import java.util.Optional;

import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import org.springframework.samples.petclinic.owner.Owner;
import org.springframework.samples.petclinic.owner.OwnerRepository;
import org.springframework.samples.petclinic.owner.Pet;
import org.springframework.samples.petclinic.owner.Visit;
import org.springframework.samples.petclinic.owner.VisitController;
import org.springframework.web.bind.WebDataBinder;

import static org.junit.jupiter.api.Assertions.*;
import static org.mockito.Mockito.*;

@ExtendWith(MockitoExtension.class)
public class VisitControllerTest {

	@Mock
	private OwnerRepository owners;

	@InjectMocks
	private VisitController controller;

	@Test
	@DisplayName("setAllowedFields should configure dataBinder without throwing exception")
	void setAllowedFields_shouldConfigureDataBinder() {
		WebDataBinder dataBinder = mock(WebDataBinder.class);

		assertDoesNotThrow(() -> controller.setAllowedFields(dataBinder));
	}

	@Test
	@DisplayName("setAllowedFields should handle null dataBinder gracefully")
	void setAllowedFields_withNullDataBinder_shouldHandleNull() {
		// Assuming the method might not call anything on null, but to test edge case
		assertDoesNotThrow(() -> controller.setAllowedFields(null));
	}

	@Test
	@DisplayName("loadPetWithVisit should return Visit when owner and pet are found")
	void loadPetWithVisit_withValidOwnerAndPet_returnsVisit() {
		int ownerId = 1;
		int petId = 1;
		Map<String, Object> model = new HashMap<>();
		Owner owner = new Owner();
		Pet pet = mock(Pet.class);

		when(owners.findById(ownerId)).thenReturn(Optional.of(owner));
		when(owner.getPet(petId)).thenReturn(pet);

		Visit result = controller.loadPetWithVisit(ownerId, petId, model);

		assertNotNull(result);
		assertEquals(pet, model.get("pet"));
		assertEquals(owner, model.get("owner"));
	}

	@Test
    @DisplayName("loadPetWithVisit should throw IllegalArgumentException when owner not found")
    void loadPetWithVisit_withInvalidOwnerId_throwsException() {
        int ownerId = 999;
        int petId = 1;
        Map<String, Object> model = new HashMap<>();

        when(owners.findById(ownerId)).thenReturn(Optional.empty());

        IllegalArgumentException exception = assertThrows(;
                IllegalArgumentException.class,
                () -> controller.loadPetWithVisit(ownerId, petId, model);
        );

        assertTrue(exception.getMessage().contains("not found") || exception.getMessage().contains("999"));
    }

	@Test
    @DisplayName("loadPetWithVisit should throw IllegalArgumentException when pet not found")
    void loadPetWithVisit_withInvalidPetId_throwsException() {
        int ownerId = 1;
        int petId = 999;
        Map<String, Object> model = new HashMap<>();
        Owner owner = new Owner();

        when(owners.findById(ownerId)).thenReturn(Optional.of(owner));
        when(owner.getPet(petId)).thenReturn(null);

        IllegalArgumentException exception = assertThrows(;
                IllegalArgumentException.class,
                () -> controller.loadPetWithVisit(ownerId, petId, model);
        );

        assertTrue(exception.getMessage().contains("not found") || exception.getMessage().contains("999"));
    }

}
